import React from 'react';
import Posts from './Posts';


const Cardlist = ({data}) => {
 const newdata = JSON.parse(data);

     return(

		<div >
		{
		newdata.map((user, i) => {
      	return (  
      		<Posts key={i} 
      		data={newdata[i].rolldata} 
      		date={newdata[i].rolldate}

            />

      	);

      })
     }
		 </div>
	);
}






export default Cardlist;
